import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import DiscographyCComponent from "./components/DiscographyCComponent";
import DiscographyMNComponent from "./components/DiscographyMNComponent";
import DiscographyOComponent from "./components/DiscographyOComponent";
import HistoryComponent from "./components/HistoryComponent";
import MerchComponent from "./components/MerchComponent";
import PublicationsComponent from "./components/PublicationsComponent";
import StartComponent from "./components/StartComponent"


const FunctionalComponent = () => {
  return (
    <div>
      <BrowserRouter>
          <Routes>
            <Route path="/" element={ <StartComponent/> }/>
            <Route path="DC-C" element={ <DiscographyCComponent/> }/>
            <Route path="DMN-C" element={ <DiscographyMNComponent/> }/>
            <Route path="DO-C" element={ <DiscographyOComponent/> }/>
            <Route path="H-C" element={ <HistoryComponent/> }/>
            <Route path="M-C" element={ <MerchComponent/> }/>
            <Route path="P-C" element={ <PublicationsComponent/> }/>
          </Routes>
      </BrowserRouter>
    </div>
  );
};

export default FunctionalComponent;
